import React from "react";
import "./Scope.css";

function Scope() {
  return (
    <>
      <h2 class="scopeOfWork darkcolor">
        <span>
        Scope Of Work
        </span>  <span class="divider-left">
        <p className='line3'></p>
        </span>
      </h2>
    </>
  );
}

export default Scope;
